import { View, Text, TurboModuleRegistry, Pressable } from "react-native";
import React from "react";
import { createDrawerNavigator } from "@react-navigation/drawer";
import {
  Entypo,
  MaterialIcons,
  FontAwesome5,
  Octicons,
  FontAwesome,
  MaterialCommunityIcons,
  Ionicons,
} from "@expo/vector-icons";
import BottomTabNavigation from "./BottomTabNavigation";
import { Account, Support, Trade, Loan, Settings, Login } from "../screens";
import CustomDrawer from "../components/CustomDrawer";
import { useSelector } from "react-redux";
import LoanRequestList from "../components/LoanRequestList";
import WithdrawalRequest from "../screens/WithdrawalRequest";
import DepositRequestList from "../components/DepositRequestList";

const Drawer = createDrawerNavigator();

const DrawerNavigation = () => {
  const currentUser = useSelector((state) => state?.userReducer?.currentUser);
  return (
    <Drawer.Navigator
      initialRouteName="Home2"
      drawerContent={(props) => <CustomDrawer {...props} />}
      screenOptions={{
        headerShown: false,
        swipeEnabled: false,
        drawerLabelStyle: { marginLeft: -20 },
        drawerStyle: { width: 400 },
      }}
    >
      {currentUser?.roleId === "admin" && (
        <>
          <Drawer.Screen
            name="AdminButton"
            options={{
              drawerLabel: "Deposit Requests",
              title: "requestList",
              headerShadowVisible: false,
              headerShown: false,
              drawerIcon: () => (
                <MaterialIcons name="smart-button" size={24} color="#000000" />
              ),
            }}
            component={DepositRequestList}
          />
          <Drawer.Screen
            name="LoanRequest"
            options={{
              drawerLabel: "Loan Requests",
              title: "Request List",
              headerShadowVisible: false,
              headerShown: false,
              drawerIcon: () => (
                <MaterialIcons name="smart-button" size={24} color="#000000" />
              ),
            }}
            component={LoanRequestList}
          />
          <Drawer.Screen
            name="WithdrawalRequest"
            options={{
              drawerLabel: "Withdrawal Requests",
              title: "Request List",
              headerShadowVisible: false,
              headerShown: false,
              drawerIcon: () => (
                <MaterialIcons name="smart-button" size={24} color="#000000" />
              ),
            }}
            component={WithdrawalRequest}
          />
        </>
      )}
      <Drawer.Screen
        name="Home2"
        options={{
          drawerLabel: "Primary Verifcation",
          title: "Futures",
          headerShadowVisible: false,
          headerShown: false,
          drawerIcon: () => (
            <Octicons name="verified" size={24} color="#000000" />
          ),
        }}
        component={BottomTabNavigation}
      />
      <Drawer.Screen
        name="Account"
        options={{
          drawerLabel: "Identity Verification",
          title: "Futures",
          headerShadowVisible: false,
          drawerIcon: () => (
            <FontAwesome5 name="address-card" size={24} color="#000000" />
          ),
        }}
        component={Account}
      />
      <Drawer.Screen
        name="Trade"
        options={{
          drawerLabel: "Email Confirmation",
          title: "Futures",
          headerShadowVisible: false,
          drawerIcon: () => (
            <MaterialCommunityIcons
              name="email-check-outline"
              size={24}
              color="#000000"
            />
          ),
        }}
        component={Trade}
      />
      <Drawer.Screen
        name="opas"
        options={{
          drawerLabel: "Change Password",
          title: "Futures",
          headerShadowVisible: false,
          drawerIcon: () => (
            <MaterialIcons name="lock-outline" size={24} color="#000000" />
          ),
        }}
        component={Loan}
      />
      <Drawer.Screen
        name="Support"
        options={{
          drawerLabel: "Support",
          title: "Futures",
          headerShadowVisible: false,
          drawerIcon: () => (
            <MaterialIcons name="support-agent" size={24} color="#000000" />
          ),
        }}
        component={Support}
      />
      <Drawer.Screen
        name="Settings"
        options={{
          drawerLabel: "Settings",
          title: "Futures",
          headerShadowVisible: false,
          drawerIcon: () => (
            <MaterialIcons name="settings" size={24} color="#000000" />
          ),
        }}
        component={Settings}
      />
      <Drawer.Screen
        name="Privacy Policy"
        options={{
          drawerLabel: "Privacy Policy",
          title: "Futures",
          headerShadowVisible: false,
          drawerIcon: () => (
            <Ionicons
              name="ios-document-text-outline"
              size={24}
              color="#000000"
            />
          ),
        }}
        component={Loan}
      />
      <Drawer.Screen
        name="Terms of Service"
        options={{
          drawerLabel: "Terms of Service",
          title: "Futures",
          headerShadowVisible: false,
          drawerIcon: () => (
            <Ionicons
              name="ios-document-text-outline"
              size={24}
              color="#000000"
            />
          ),
        }}
        component={Loan}
      />
    </Drawer.Navigator>
  );
};

export default DrawerNavigation;
